window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling Author Raymond L. Weil comes the first book in a new military science fiction series.</p> <p><b>Can Earth save the Human Empire?</b></p> <p>The Confederation consists of the seven oldest races in known space. They control a vast section of the galaxy. All races in that part of the galaxy are subjects of the Confederation and forced to obey the Confederationâ€™s laws.</p> <p>The Human Empire is well aware of the Confederation and has been careful not to intrude upon Confederation space. However, now the Confederation has decided the Human Empire has grown too large and needs to be brought under control of the seven races.</p> <p>Warfleets are dispatched, and soon massive space battles erupt throughout the Empire. Can the Humans survive or is the time of the Empire over?</p>"; 
